import{_ as a,o as l,c as i,R as e}from"./chunks/framework.89ffed42.js";const q=JSON.parse('{"title":"Life","description":"","frontmatter":{},"headers":[],"relativePath":"life/index.md","filePath":"life/index.md"}'),r={name:"life/index.md"},t=e('<h1 id="life" tabindex="-1">Life <a class="header-anchor" href="#life" aria-label="Permalink to &quot;Life&quot;">​</a></h1><h2 id="this-life-home" tabindex="-1">THis Life home 😚 <a class="header-anchor" href="#this-life-home" aria-label="Permalink to &quot;THis Life home :kissing_closed_eyes:&quot;">​</a></h2><p>20221206 生活就是一地鸡毛</p><p>20230104 生活就像打仗，每天都有新的敌人，而我要做的就是从不放弃</p><h2 id="打车" tabindex="-1">打车 <a class="header-anchor" href="#打车" aria-label="Permalink to &quot;打车&quot;">​</a></h2><p>顺风车打车经验：</p><ul><li><p>1.提前半小时安排出行，比如老妈打车 10 点出发，那就要打九点半的车</p></li><li><p>2.车主接单后，一定要打电话确认，如果做不到在约定的时间内赶到，请及时说出来，我有急事，着急回去。</p></li></ul><h2 id="做饭" tabindex="-1">做饭 <a class="header-anchor" href="#做饭" aria-label="Permalink to &quot;做饭&quot;">​</a></h2><ul><li>清蒸鲈鱼</li><li>风干的牛肉炒大白菜很好吃</li><li>海底捞吃饭，不用双拼底料，麻辣底料自己制作搅拌下就好</li></ul><h2 id="囤药" tabindex="-1">囤药 <a class="header-anchor" href="#囤药" aria-label="Permalink to &quot;囤药&quot;">​</a></h2><ul><li>鼻炎药 孟鲁司特钠</li><li>鼻炎药 盐酸非索非那定片</li><li>如何通过保险报销药品，已购门诊险。</li><li>感冒药收集，主要：感康/快客/白加黑</li><li>退烧相关：布洛芬/乙酰氨基酚(孕妇能吃)</li></ul><h2 id="考研借到异地考试" tabindex="-1">考研借到异地考试 <a class="header-anchor" href="#考研借到异地考试" aria-label="Permalink to &quot;考研借到异地考试&quot;">​</a></h2><ul><li><a href="https://zsb.gench.edu.cn/" target="_blank" rel="noreferrer">上海考研地点</a></li><li>一定要到考场附近酒店住下来，考研每天来回奔波很是辛苦</li></ul><h2 id="考研当天" tabindex="-1">考研当天 <a class="header-anchor" href="#考研当天" aria-label="Permalink to &quot;考研当天&quot;">​</a></h2><ul><li>犯了一个 fatal 的错误，且难以弥补，懊悔不已，身份证和准考证没带过去</li><li>后续所有的事情坚决要以核心事情为准，且一定要优先处理，其他次要事情往后处理</li></ul><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>可能终生难以释怀！</p></div><h2 id="双房见家长" tabindex="-1">双房见家长 <a class="header-anchor" href="#双房见家长" aria-label="Permalink to &quot;双房见家长&quot;">​</a></h2><ul><li>家家有本难念的经，我家这本特别难念，老丈人很难搞定，而且关系很僵。不知道咋处理了？</li><li>正常家庭来说，父母都是疼爱子女的，遇到一个不疼爱自己的父母很难搞得定，而且又是远嫁，没有优势？</li><li>父母不同意原因？大胆猜测下 1.远嫁，解决之道：高铁飞机方便，逢年过节尽量回来看望父母 2.经济，彩礼需要攒一攒，可能超过想象，但是只要是一个可控的范围都好接受 3.婚后生活，年轻人还是要靠自己奋斗，所以只要自己足够努力，生活质量还是阔以保证的 4.结婚后小孩姓谁，如果非要入赘才能同意婚事，这个我得需要跟父母商量商量</li></ul><h2 id="_2023-年过年拜访记录" tabindex="-1">2023 年过年拜访记录 <a class="header-anchor" href="#_2023-年过年拜访记录" aria-label="Permalink to &quot;2023 年过年拜访记录&quot;">​</a></h2><h3 id="_0115-0116" tabindex="-1">0115-0116 <a class="header-anchor" href="#_0115-0116" aria-label="Permalink to &quot;0115-0116&quot;">​</a></h3><ul><li>人生就是一场表演，要演的真实也要演的出彩</li><li>内心还是不欢迎，但好在比最坏的结果好一点</li><li>送礼不能太重，又不能很轻，这个度很难把握</li></ul><h3 id="_0117-0118" tabindex="-1">0117-0118 <a class="header-anchor" href="#_0117-0118" aria-label="Permalink to &quot;0117-0118&quot;">​</a></h3><ul><li>买不到直达长沙的车票，买了同一趟去杭州的票，然后坐在餐车上坐到了湖南，我在怀疑，为啥抢票这么难，难道非要用携程或者飞猪此类的抢票软件？</li><li>去之前的前一晚准备理发，价格翻番，人满为患，第二天去湖南理得发</li><li>下次去直接预约到衡南县硫市的顺风车</li></ul><h3 id="_0119" tabindex="-1">0119 <a class="header-anchor" href="#_0119" aria-label="Permalink to &quot;0119&quot;">​</a></h3><ul><li>在对象家见了姑姑和姑父们，不会喝酒，就这样吧</li><li>还是有点紧张，睡眠睡得不安，有点长痘</li><li>还是不能放弃学习</li></ul><h3 id="_0120" tabindex="-1">0120 <a class="header-anchor" href="#_0120" aria-label="Permalink to &quot;0120&quot;">​</a></h3><ul><li>今天跟对象父母单独吃了饭，没啥特别，也没有啥不好</li><li>最近几天睡眠不是很好，脸上因为压力过大还长了痘痘，最近几天早点休息</li></ul><h3 id="_0121" tabindex="-1">0121 <a class="header-anchor" href="#_0121" aria-label="Permalink to &quot;0121&quot;">​</a></h3><ul><li>今日除夕，大清早的起来不知道要忙些啥</li><li>在对象的第三天，坚持住，还有 3 天</li></ul><h3 id="_0122" tabindex="-1">0122 <a class="header-anchor" href="#_0122" aria-label="Permalink to &quot;0122&quot;">​</a></h3><p>大年初一，在对象家睡大觉</p><h3 id="_0123" tabindex="-1">0123 <a class="header-anchor" href="#_0123" aria-label="Permalink to &quot;0123&quot;">​</a></h3><ul><li>初二拜访亲戚，喝酒禁忌，要么喝一点，要么一点不喝，如果不喝酒怎么敬长辈，而且敬长辈的时候需要要说祝福语，敬长辈的时候基本肯定要说，‘敬您一杯，祝您身体健康，万事如意’，敬长兄，祝福语，工作顺利之类的</li><li>自己的衣服自己的注意，包括洗和晒，记得自己收拾</li></ul><h3 id="_0124" tabindex="-1">0124 <a class="header-anchor" href="#_0124" aria-label="Permalink to &quot;0124&quot;">​</a></h3><ul><li>从衡阳坐车回到岳阳，一路颠簸，从硫市出发到衡阳东站，顺风车 60</li><li>从衡阳东站到长沙南站，车票 80*2</li><li>从长沙南站打车到湘阴原种场，车费 120</li></ul><h3 id="_0125" tabindex="-1">0125 <a class="header-anchor" href="#_0125" aria-label="Permalink to &quot;0125&quot;">​</a></h3><p>拜访了二姨，因为在二姨池塘边谈论再起争执，对于此事已是非常无语，失望至极，一个人站在池塘边吹了好久的冷风</p><h3 id="_0126" tabindex="-1">0126 <a class="header-anchor" href="#_0126" aria-label="Permalink to &quot;0126&quot;">​</a></h3><ul><li>吃晚饭前，因为把锅子放到了桌子上有争执</li><li>约个顺风车 都有矛盾，以后所有的越顺风车这事，尽量都是我来说</li></ul><h3 id="_0127" tabindex="-1">0127 <a class="header-anchor" href="#_0127" aria-label="Permalink to &quot;0127&quot;">​</a></h3><ul><li>很早就吃完早饭，搭上了顺风车，因为便宜所以司机一般会多载几个人，这时候就要跟司机确定好，最后一个顺风车乘客是几点，如果觉得风险太大，那就提前两个小时到，比如 2 点的高铁，那就约 10 点的顺风车。一旦赶不上就得折返，损失太大</li><li>8 年后再次历经春运，这次没有抢到回来的票，当时还天真以为能买到站票，失策了，站票都没有抢到，教训深刻</li><li>长沙到金华的票阔以当作备选方案</li></ul><h3 id="_0128" tabindex="-1">0128 <a class="header-anchor" href="#_0128" aria-label="Permalink to &quot;0128&quot;">​</a></h3><ul><li>终于安全顺利回到上海</li></ul><h2 id="_2023-年目标" tabindex="-1">2023 年目标 <a class="header-anchor" href="#_2023-年目标" aria-label="Permalink to &quot;2023 年目标&quot;">​</a></h2><p>新的一年，首要目标还是生存，生活都谈不上。又是苦逼搬砖的一年。 这次去拜访长辈花销巨大，希望新的一年多攒点钱，除了吃喝这块，其他消费一切都要谨慎，再三问几遍，这个东西是否真的需要？又不是不能用，如果不是特别紧急就不需要购入</p><h3 id="租房" tabindex="-1">租房 <a class="header-anchor" href="#租房" aria-label="Permalink to &quot;租房&quot;">​</a></h3><p>每次看到出租房视频，住的是什么环境，很无奈，都是最底层的打工仔，生活很无奈，一个人还好，如果是一家子就比较尴尬</p><h3 id="老妈买社保的事-烦心事-没钱-贫穷限制了我的想象" tabindex="-1">老妈买社保的事，烦心事，没钱，贫穷限制了我的想象 <a class="header-anchor" href="#老妈买社保的事-烦心事-没钱-贫穷限制了我的想象" aria-label="Permalink to &quot;老妈买社保的事，烦心事，没钱，贫穷限制了我的想象&quot;">​</a></h3><p>说到底还是没钱，一个人好辛苦，为此上午都没有休息好，活着真不容易。 这应该是我在成家之前干的最后一件对爸妈好的事，后面有小家了，不确定因素更多。总之一点就是没钱，欲望还大！</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>很好的福利结果最终还是取消了！！！</p></div><h3 id="商业贷款" tabindex="-1">商业贷款 <a class="header-anchor" href="#商业贷款" aria-label="Permalink to &quot;商业贷款&quot;">​</a></h3><p>目前还有 60 万的商业贷款需要还，利率目前还是 5.1%，每次提前多还十万，每个月就能少还 600，什么时候才能攒够 60 万，人比人气死人，也没有好比较的，啃老不行只能靠自己！</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>每次听光辉岁月都是不同的感受</p></div>',53),o=[t];function h(n,d,s,u,c,b){return l(),i("div",null,o)}const f=a(r,[["render",h]]);export{q as __pageData,f as default};
